import { CommonModule } from '@angular/common';
import { Component, HostListener, OnInit } from '@angular/core';
import { Router, RouterModule } from '@angular/router';
import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import { FormsModule } from '@angular/forms';
import { HeaderComponent } from '../common/header/header.component';
import { NewsService } from './service/news.service';
import { NewsParameters } from './model/NewsParameters';
import { AppNewsGridAComponent } from './app-news-grid/app-news-grid-a/app-news-grid-a.component';
import { AppNewsGridBComponent } from './app-news-grid/app-news-grid-b/app-news-grid-b.component';
import { AuthenticationService, UserDto } from '../login-modal/service/authentication.service';
import { CreateNewComponent } from "./create-news/create-new/create-new.component";
import { CategoryDto, CategoryService } from './service/category.service';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-news',
  standalone: true,
  templateUrl: './news.component.html',
  styleUrl: './news.component.scss',
  imports: [CommonModule, RouterModule, FontAwesomeModule, HeaderComponent, AppNewsGridAComponent, AppNewsGridBComponent, FormsModule, CreateNewComponent]
})
export class NewsComponent implements OnInit {
  userDto!: UserDto | null;
  faPlus = faPlus;
  isShowCreateNewModal = false;
  selectedCategory = '';
  selectedDate = '';
  selectedNews: any = null;
  categories: CategoryDto[] = [];
  news: NewsParameters[] = [];
  filteredNews: NewsParameters[] = [];
  loading: Boolean = true;
  blocks: NewsParameters[][] = [];

  pageSize = 13;
  page = 0;

  constructor(private newsService: NewsService, private route: ActivatedRoute, private router: Router, private authService: AuthenticationService, private categoryService: CategoryService) { }

  ngOnInit() {
     this.categoryService.getAllCategories().subscribe(res => {
    this.categories = res;
  });
    this.loadNews();
    this.loadMore();
    this.authService.user$.subscribe(user => {
      this.userDto = user;
    });

    //Actualizamos cada vez que se llene
    this.newsService.newsList$.subscribe(news => {
      this.news = news;
      this.loading = false;
    });
  }

  //Se ejecuta cuando accedemos a el desde el html
  get finished(): boolean {
    const list = this.filteredNews.length ? this.filteredNews : this.news;
    return (this.page * this.pageSize) >= list.length;
  }


loadNews() {
  this.newsService.getAllNews().subscribe(allNews => {

      this.news = allNews.map(n => ({
        newsDto: n.newsDto,
        publishedAt: n.publishedAt,
        updatedAt: n.updatedAt,
        comments: n.comments || []
      }));

    this.news = this.news.sort((a, b) =>
      (b.newsDto.isFeatured ? 1 : 0) - (a.newsDto.isFeatured ? 1 : 0)
    );

    this.applyFilters();
  });
}


  loadMore() {
    //Si viene vacio sacamos todas las noticias
    const list = this.filteredNews.length ? this.filteredNews : this.news;

    const start = this.page * this.pageSize;
    const end = start + this.pageSize;

    let slice = list.slice(start, end);

    if (!slice.length) return;

    // añade placeholders si faltan para completar 12
    while (slice.length < 12) {
      slice.push(this.placeholder());
    }

    this.blocks.push(slice);
    this.page++;
  }

  applyFilters() {
  const catNew = this.selectedCategory.trim().toLowerCase();
  const dateNew = this.selectedDate.trim().toLowerCase();

  this.filteredNews = this.news.filter(n => {
    const category = !catNew || n.newsDto.categoryId?.toLowerCase() === catNew;
    const date = !dateNew || this.isInDateRange(n.publishedAt, dateNew);
    return category && date;
  });

  // Reordenar por featured
  this.filteredNews = this.filteredNews.sort((a, b) => {
    return (b.newsDto.isFeatured ? 1 : 0) - (a.newsDto.isFeatured ? 1 : 0);
  });

  this.blocks = [];
  this.page = 0;
  this.loadMore();
}

  private placeholder(): NewsParameters {
    return {
    newsDto: {
      id: 0,
      title: 'Próximamente',
      content: 'Próximamente',
      categoryId: null,
      image64: '',
    },
      publishedAt: new Date()
    } as NewsParameters;
  }

  private isInDateRange(publishedAt: string, range: string): boolean {
    const created = new Date(publishedAt);
    const now = new Date();

    if (range === 'today') return created.toDateString() === now.toDateString();

    if (range === 'week') {
      const s = new Date(now);
      s.setDate(now.getDate() - 7);
      return created >= s;
    }

    if (range === 'month') {
      const s = new Date(now);
      s.setMonth(now.getMonth() - 1);
      return created >= s;
    }

    return true;
  }

  moreDetails(id: number) {
    this.router.navigate(['noticias/' + id]);
  }

openEditModal(news: any) {
  this.selectedNews = news;
  this.isShowCreateNewModal = true;
}

  openCreateNewModal(): void {
    this.selectedNews = null;
    this.isShowCreateNewModal = true;
  }

  closeCreateNewModal(): void {
    this.isShowCreateNewModal = false;
  }
}
